import { useState } from 'react'

const CollapseFilter = ({title, component}) => {
    const [open, setOpen] = useState(true)


    const handleClick = () => {
        setOpen(!open)
        console.log(open)
    }
    return (
        <div>
            <div className="collapse-header">
                <h2>{title}</h2>
                <button onClick={handleClick}>A</button>
            </div>
            {open && component}
        </div>
    )
}

export default CollapseFilter
